const Layout = (props) => {

    return (<div>
      <Head>
        <title>Harvest</title>
        <meta charSet='utf-8' />
        <meta name='viewport'
          content='initial-scale=1.0, width=device-width' />
      </Head>
      {style}
      <body>
      {user ? props.children : <SignIn/>}
      <Footer/>
      </body>
    </div>);

}
export default Layout;
